import React, { Component } from 'react'
import {Table} from 'react-bootstrap';

export class Book extends Component {

    constructor(props){
        super(props);
        this.state={books:[]}
    }
    refreshList(){
        fetch("https://localhost:44305/api/Books")
        .then(response => response.json())
        .then(data => {
            this.setState({books:data})
        })   
    }

    componentDidMount(){
        this.refreshList();
    }

    render() {
        const {books} = this.state;
        return (
            <div>
                <Table>
                    <thead>
                        <tr>
                            <th>id</th>
                            <th>title</th>
                            <th>authore</th>
                            <th>description</th>
                        </tr>
                    </thead>
                    <tbody>
                        {books.map(book=>
                        <tr key={book.Id}>
                            <td>{}</td>
                            <td>{}</td>
                            <td>{}</td>
                            <td>{}</td>
                        </tr>
                        )}
                    </tbody>
                </Table>
            </div>
        )
    }
}

export default Book
